import React from "react";

export default function ViewCustomer(props) {
   return ( 
   <div  style = {{
    textAlign: "left",
    marginLeft: "20px",
}}  >
      <div><h3>Username : {props.CustomerDetails.username}</h3></div>
      <div><h3>First Name : {props.CustomerDetails.firstname}</h3></div>
      <div><h3>Last Name : {props.CustomerDetails.lastname}</h3></div>
      <div><h3>DOB : {props.CustomerDetails.dob}</h3></div>
      <div><h3>Phone : {props.CustomerDetails.phone}</h3></div>
      <div><h3>Email : {props.CustomerDetails.email}</h3></div>
      <div><h3>Address : {props.CustomerDetails.address}</h3></div>
      <div><h3>PAN Number : {props.CustomerDetails.pan}</h3></div>
    </div>
);
}
